                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                </div>
                </div>
            </div>
        )
    }   
}
